import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import init from "./pkg/wasm_lib";

init().then(() => {
    ReactDOM.render(
        <React.StrictMode>
            <App />
        </React.StrictMode>,
        document.getElementById('root')
    );
});
